const AboutAdmin = () => {
    const {currentUser} = useContext(AuthContext);
    const navigate = useNavigate();
    useEffect(() => {
        console.log(currentUser)
        if (!currentUser) {
            navigate("/login");
        }
    });

    if (!currentUser) {
        return null;
    }

    return (
        <div>
            <AdminNavbar/>
            <EditAbout/>
        </div>
    );
}

export default AboutAdmin;
